INSERT INTO `shoe_products` VALUES ('153265-002','Jordan 12 Retro Flu Game (2025) (GS)','Jordan','Black/Varsity Red',9,'U101','https://images.stockx.com/images/Air-Jordan-12-Retro-Flu-Game-2025-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740684307','2025-03-01','The 2025 version of the Air Jordan 12 Retro GS \'Flu Game\' nods back to an ailing Michael Jordan, who suited up and dominated Game 5 of the 1997 NBA Finals. A black tumbled leather upper gets radiating stitch lines and red, lizard-textured overlays. More red complements the rubber outsole, tooled with herringbone traction pods and an exposed carbon fiber shank plate for stability.'),('309755-01','Puma LaMelo Ball MB.01 Iridescent','Puma','Lilac Chiffon/Light ',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Iridescent-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-02-02','Rocking a subtle lilac hue, the PUMA MB.01 ‘Iridescent’ has an engineered mesh upper, highlighted by embroidered details and bolstered with matching overlays. LaMelo Ball’s wings logo graces the tongue, matching the aqua Formstrip and the ‘1 of 1’ tagline found on both sides of the forefoot. PUMA’s NITROFOAM midsole keeps every step soft and lightweight.'),('309847-01','Puma LaMelo Ball MB.03 Porsche','Puma','Sport Yellow/Sport Y',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Porsche-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-02-17','The Porsche x PUMA MB.03 \'Sport Yellow\' dons an engineered mesh upper bolstered with suede details on the forefoot and eyestay. Claw marks throughout the upper give them a rugged look. A Porsche Turbo signoff can be found on the bottom eyestay, while both logos adorn the padded heel. The NITROFOAM midsole has speckled details throughout, anchored by a wave-pattern rubber outsole that bleeds into different sections of the upper.'),('310511-01','Puma LaMelo Ball MB.03 Miami','Puma','Teal/Pink',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Miami-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-07-05','No description available'),('310512-01','Puma LaMelo Ball MB.03 Miami (GS)','Puma','Teal/Pink',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Miami-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1730387616','2024-07-01','No description available'),('310519-01','Puma LaMelo Ball MB.03 Lo Team Hyperlink Blue','Puma','Hyperlink Blue/Brigh',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Lo-Team-Hyperlink-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-07-31','The PUMA MB.03 Lo Team \'Hyperlink Blue\' has an aqua-colored mesh upper with patterned synthetic overlays in multiple shades of blue. A padded collar keeps you comfortable as soon as you put your shoes on, while laces feed through webbed eyelets for a lockdown feel. An ice blue NITROFOAM midsole couples with a sturdy PUMAGRIP outsole for a plush ride.'),('310697-01','Puma LaMelo Ball MB.04 LaFrancé','Puma','Team Light Blue/Cool',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-LaFrance-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-09-12','The LaFrancé x PUMA MB.04 \'1 of 1\' rolls out a bright blue engineered mesh upper overlaid with an ornate 5D printed cage. LaMelo Ball\'s \'Rare\' and \'1 of One\' taglines appear on the upper for a signature look. A NITROFOAM midsole is anchored by a PUMAGRIP rubber outsole.'),('310775-01','Puma LaMelo Ball MB.04 LaFrancé (GS)','Puma','Team Light Blue/Cool',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-LaFrance-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1728393099','2024-09-12','The LaFrancé x PUMA MB.04 Jr \'1 of 1\' rolls out a powder blue engineered mesh upper with matching synthetic overlays that mix with LaMelo Ball\'s taglines, \'1 of 1\' and \'Rare.\' LaFrancé, LaMelo\'s lifestyle fashion brand, signs off on the vamp, while an \'LF\' nod is embossed on the heel. A full-length NITFROFOAM midsole keeps every step lightweight, anchored by a bottom-loaded shank and a PUMAGRIP rubber outsole.'),('310776-01','Puma LaMelo Ball MB.04 Scooby-Doo','Puma','Aquatic/Lime Smash/H',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Scooby-Doo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-27','The Scooby-Doo x PUMA MB.04 \'Mystery Machine\' brings a nostalgic colorway inspired by the Mystery Inc. gang\'s van. The 5D printed turquoise mesh upper gets alien tentacle overlays in lively orange and lime green. Appliqued flowers adorn the side panels, while a Scooby-Doo graphic complements the heel. A plush NITROFOAM midsole couples with a PUMAGRIP rubber outsole underfoot.'),('310836-01','Puma LaMelo Ball MB.04 Iridescent','Puma','Deep Orchid/Poison P',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Iridescent-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738250306','2024-11-15','No description available'),('310864-01','Puma LaMelo Ball LaFrancé Amour Moment','Puma','Alpine Snow',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Moment-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-07-19','No description available'),('310865-01','Puma LaMelo Ball LaFrancé Amour Untouchable','Puma','Puma Black/Glowing P',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Untouchable-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-07-19','No description available'),('310866-01','Puma LaMelo Ball LaFrancé Amour 1 of 1','Puma','Team Light Blue',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-1-of-1-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-09-12','No description available'),('310867-01','Puma LaMelo Ball LaFrancé Amour Gifted','Puma','Orange/Black',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Gifted-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-08','The PUMA LaFrancé \'Gifted\' carries an orange mesh and leather upper, secured with extra-wide laces and bolstered with a heel counter. A leather \'LF\' tag graces the padded tongue, while LaMelo\'s 1 of 1 logo is embossed on the toe box. These shoes have a matching orange rubber cupsole tooled with a full-length foam midsole for a plush feel.'),('310868-01','Puma LaMelo Ball LaFrancé Amour Slime','Puma','Emerald Green',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Slime-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740156502','2024-10-18','No description available'),('310869-01','Puma LaMelo Ball LaFrancé Amour Valentine\'s Day','Puma','Pink/Cream',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Valentines-Day-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1739999510','2025-02-19','The PUMA LaFrancé \'Pink Carpet\' rocks extra-wide shoelaces that feed through corded eyelets to secure the hot pink mesh upper. A molded heel counter provides a bit of extra stability, while a stuffed tongue is stamped with a suede \'LF\' signoff patch. These shoes have a matching rubber cupsole with LaMelo Ball\'s signature callouts, including \'01 of One\' and \'Not From Here\' embossed on the sidewall.'),('310870-01','Puma LaMelo Ball LaFrancé Amour Moment (GS)','Puma','Alpine Snow',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Moment-GS.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1725984354','2024-07-19','No description available'),('310872-01','Puma LaMelo Ball LaFrancé Amour 1 of 1 (GS)','Puma','Team Light Blue',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-1-of-1-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1739472889','2024-09-12','No description available'),('311307-01','Puma LaMelo Ball MB.04 Teenage Mutant Ninja Turtle','Puma','Fluro Green Pes/PUMA',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Teenage-Mutant-Ninja-Turtles-Leonardo-and-Michelangelo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1739826642','2025-02-14','The Teenage Mutant Ninja Turtles x PUMA MB.04 \'Leonardo & Michelangelo\' play on LaMelo Ball\'s \'Not From Here\' tagline, using a green tentacle-like overlay that wraps around the blue mesh upper of Leonardo\'s right shoe and the orange mesh upper of Michelangelo\'s left shoe. \'L\' and \'M\' signoffs adorn each tongue, while a bandana-inspired Formstrip decorates the side. A lightweight NITROFOAM midsole is anchored by a sturdy PUMAGRIP rubber outsole.'),('311308-01','Puma LaMelo Ball MB.04 Phoenix','Puma','Red/Orange/Blue',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Phoenix-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-12-06','The PUMA MB.04 \'Phoenix\' uses red flame graphics on the orange woven mesh upper. These shoes are tangled in a web of yellow and purple synthetic overlays. They spell out \'Rare\' on the toe box, \'1 of One\' on the side, and \'1 Love\' on the opposite side. A red NITROFOAM midsole is bolstered by sculpted, blue guardrails. The rubber outsole showcases LaMelo Ball\'s \'Not From Here\' motto.'),('311310-01','Puma LaMelo Ball MB.04 Reflections','Puma','Black/Blue',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Reflections.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1744921547','2025-05-02','The PUMA MB.04 \'Reflections\' sports a black mesh upper wrapped in a 5D-printed overlay that shines in metallic blue and purple. A snaking design replicates alien tentacles inspired by LaMelo\'s otherworldly game, while a graphic on the heel showcases a disco LaMelo emoji. The NITROFOAM midsole works in tandem with a sturdy rubber outsole, adorned with a hovering spaceship, etched flames, and Ball\'s \'Not From Here\' motto.'),('311318-01','Puma LaMelo Ball MB.04 Lo Alien Skin','Puma','Ultra Blue/Luminous ',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Lo-Metamorphosis-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746403261','2025-04-18','No description available'),('311327-01','Puma LaMelo Ball MB.03 Lo Teenage Mutant Ninja Tur','Puma','Pink/Purple/Yellow',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Lo-Teenage-Mutant-Ninja-Turtles-Krang-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1739912872','2025-02-22','The Teenage Mutant Ninja Turtles x PUMA MB.03 Lo \'Krang\' nods to the crime fighting squad\'s long-time nemesis. These shoes have a lavender mesh upper with pink synthetic overlays that mirror Krang\'s alien texture. Krang\'s face adorns the tongue tag, while his yellow eyes grace the forefoot. Both logos appear on the heel and insoles. A pink NITROFOAM midsole is wrapped in speckles for a final touch.'),('311333-02','Puma LaMelo Ball LaFrancé Mother\'s Day','Puma','Purple/Purple',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Mothers-Day-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746825090','2025-05-09','No description available'),('311334-01','Puma LaMelo Ball LaFrancé Amour Chrome Silver','Puma','Silver/Silver Mist/S',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Chrome-Silver-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1743801101','2025-03-12','No description available'),('311335-01','Puma LaMelo Ball LaFrancé Amour Black','Puma','Black',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-LaFrance-Amour-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1741295560','2025-03-12','No description available'),('311340-01','Puma LaMelo Ball LaFrancé Amour Black (GS)','Puma','Black/Silver',9,'U101','https://images.stockx.com/images/puma-lamelo-ball-lafrance-amour-black-gs.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740772806','2025-03-12','No description available'),('312055-01','Puma LaMelo Ball MB.04 Teenage Mutant Ninja Turtle','Puma','Fluro Green Pes/PUMA',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB04-Teenage-Mutant-Ninja-Turtles-Raphael-and-Donatello-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740156527','2025-02-08','The Teenage Mutant Ninja Turtles x PUMA MB.04 \'Donatello & Raphael\' nods to the smartest and strongest members of the Turtles team. Alien tentacles represent LaMelo Ball\'s \'Not From Here\' tagline, while a bright green synthetic overlay wraps around the mesh upper, using Donatello\'s purple on the left shoe and Raphael\'s red on the right. Their respective bandanas take part in the PUMA Formstrip, while \'D\' and \'R\' graphics decorate each tongue. The NITROFOAM midsole partners with a PUMAGRIP rubber outsole underfoot.'),('315122-001','Nike Air Force 1 Low \'07 Black','Nike','Black/Black',9,'U101','https://images.stockx.com/images/Nike-Air-Force-1-07-Black-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-07-05','The all-black Air Force 1 Low is a timeless classic in Nike\'s catalog of heritage sneakers.\n<br>\n<br>\nThe Nike Air Force 1 Low \'07 Black features a triple black smooth leather upper with a matching Air sole and laces. Subtle Nike Air embroidery on the heel tab nods to the history of the AF-1 line. A metallic lace tag and woven tongue label complete the design.\n<br>\n<br>\nThe Nike Air Force 1 Low \'07 retails for $115.'),('315122-111','Nike Air Force 1 Low \'07 White','Nike','White/White',9,'U101','https://images.stockx.com/images/Nike-Air-Force-1-Low-White-07_V2-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2007-01-01','The Nike Air Force 1 Low White ‘07 features an all-white leather upper with a perforated toe box and Swoosh overlays. A Nike heel embroidery and white sole completes the design.\n<br>\n<br>\nThe Nike Air Force 1 Low White ‘07 originally released in 2007, but since it is an essential colorway to the brand, it consistently restocks.\n<br>\n<br>\nTo shop all Nike Air Force 1 shoes, <a href=\"https://stockx.com/nike/air-force/1\">click here.</a> '),('374915-02','Puma Suede Classic XXI Red','Puma','High Risk Red-Puma W',9,'U101','https://images.stockx.com/images/Puma-Suede-Classic-XXI-Red-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1696453776','2021-02-19','No description available'),('376678-02','Puma LaMelo Ball MB.01 Iridescent Dreams','Puma','Puma Black',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Iridescent-Dreams-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-08-22','LaMelo Ball\'s signature shoe, the PUMA MB.01 \'Iridescent Dreams\' combines a sleek all-black design with shiny details. The sneaker features a black mesh upper with seamless overlays and unique collar stitching. An iridescent \'1 of 1\' tag adorns the tongue and the vamp displays the words \'Not From Here.’ The lightweight shoe rests on a tough, non-slip rubber outsole that supports a black NITRO foam midsole.'),('376848-01','Puma LaMelo Ball MB.01 Breast Cancer Awareness','Puma','Pink Alert',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Breast-Cancer-Awareness-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-09-29','A special-edition shoe released with Susan G. Komen, a breast cancer organization, the PUMA MB.01 \'Breast Cancer Awareness\' is a bright colorway of LaMelo Ball\'s first signature shoe. The mesh upper appears in red with dark pink overlays on the front, and rides on a red midsole. \'Not From Here,’ LaMelo’s tagline, is displayed on the vamp, while The Komen Foundation\'s ribbon logo adorns the tongue.'),('376941-04','Puma LaMelo Ball MB.01 White Silver','Puma','Puma White/Silver',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-White-Silver-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-07-13','Debuting as part of the ‘Team Colors’ lineup, the PUMA MB.01 Lo ‘Triple White’ sports a white monomesh upper complemented by matching no-sew overlays on the forefoot. LaMelo Ball\'s ‘Not From Here’ tagline is stamped on the upper, adorned with embroidered details on the collar. A woven ‘1 of 1’ tag is stamped on the padded mesh tongue, while a Nitro Foam midsole is contained within a plastic frame for enhanced stability.'),('376941-07','Puma LaMelo Ball MB.01 Lo Green Gecko','Puma','Green Gecko/Castlero',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Lo-Green-Gecko-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-10-21','No description available'),('377411-02','Puma LaMelo Ball MB.02 Rick & Morty Adventures','Puma','Safety Yellow/Elektr',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB02-Rick-and-Morty-Adventures-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1676641693','2023-02-17','The PUMA MB.02 \'Adventures\' shoe brings the animated TV show Rick & Morty back to LaMelo Ball\'s signature series. Melo\'s second signature shoe boasts a unique mismatched design, with a neon yellow and pink gradient on one shoe and a gradient of green and purple on the other. The upper, made of engineered mesh, is embellished with LaMelo\'s signature wing graphic. The words ‘Rick and Morty’ appear on the toe area, and character images from the show can be found on the tongue tag and insole. The shoe is designed for performance on the basketball court, featuring a responsive NITRO-infused foam midsole and a rubber outsole with a wings-inspired traction pattern for grip.'),('378916-01','Puma LaMelo Ball MB.03 Toxic','Puma','Purple Glimmer/Green',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Toxic-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-10-27','The PUMA MB.03 ‘Toxic’ takes inspiration from an alien underworld, using purple and teal along with claw marks revealing a pink mesh underlay. Laces feed through webbing eyelets to provide a snug feel, while a padded collar keeps you comfortable the moment you lace them up. PUMA’s NITROFOAM radiant pink midsole provides soft cushioning, wrapped up by a fluorescent green rubber outsole for eye-catching contrast.'),('379221-01','Puma LaMelo Ball MB.03 Blue Hive','Puma','PUMA Black/Electric ',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-Blue-Hive-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-12-08','No description available'),('379223-01','Puma LaMelo Ball MB.01 Golden Child','Puma','Metallic Gold/Fiery ',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB01-Golden-Child-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-11-24','Originally debuting as an exclusive player edition colorway, the PUMA MB.01 ‘Golden Child’ is made of an engineered mesh upper with welded metallic gold overlays. LaMelo Ball’s signature wings logo adorns the tongue, while his ‘1 of 1’ tagline is printed on the side of the forefoot. These sneakers have a NITROFOAM midsole, wrapped in a shiny cage and coupled with a see-through rubber outsole.'),('379328-01','Puma LaMelo Ball MB.03 KidSuper','Puma','Pink Lilac/Team Ligh',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB03-KidSuper-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-05-09','Designed in partnership with New York-based artist Colm Dillane, the KidSuper Studios x PUMA MB.03 \'Pink Lilac\' has a pink woven mesh upper with an illustrative allover print consisting of different facial features. A pink NITROFOAM midsole matches the rest of the upper, anchored by a rubber outsole that wraps up the toe and part of the sidewalls.'),('379420-01','Puma LaMelo Ball MB.02 Oreo','Puma','Black/White/Oreo',9,'U101','https://images.stockx.com/images/Puma-LaMelo-Ball-MB02-Oreo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1692885911','2023-08-11','No description available'),('396520-01','Puma Suede One Piece Buggy','Puma','For All Time Red/Ult',9,'U101','https://images.stockx.com/images/Puma-Suede-One-Piece-Luffy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim