rand and the renowned Italian football club. This jersey combines Puma\'s expertise in sportswear with OFF-WHITE\'s distinctive design aesthetic, resulting in a unique piece that blends athletic functionality with high-fashion appeal. The black base color serves as a canvas for bold graphics and branding elements, making this jersey stand out both on and off the pitch. Crafted with premium materials, this replica jersey offers comfort and style for fans and fashion enthusiasts alike. The design incorporates AC Milan\'s traditional elements while infusing them with OFF-WHITE\'s signature industrial-inspired touches. This limited edition piece showcases the perfect fusion of sports heritage and contemporary streetwear, making it a must-have for collectors and supporters of both brands. Our team thinks this product is great for those who appreciate the intersection of high-fashion and sports culture, offering a unique way to show support for AC Milan while making a bold style statement.'),('AQ9129-170','Jordan 4 Retro Metallic Gold (Women\'s)','Jordan','Sail/Metallic Gold/B',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Metallic-Gold-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-03-09','The Women’s Air Jordan 4 Retro ‘Metallic Gold’ has a smooth leather upper with a subtle off-white finish and metallic gold eyelets for a regal look. These shoes have a breathable quarter panel netting and a debossed Jumpman logo on the tongue. The prominent molded heel tab backs a plush collar. Underneath, a soft midsole reveals an Air-sole heel unit for soft cushioning. The classic herringbone rubber outsole provides traction and optimal grip.'),('B75571','adidas Yeezy Boost 700 Wave Runner','Adidas','Solid Grey/Chalk Whi',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Wave-Runner-700-Solid-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2017-11-01','This first colorway of Yeezy Wave Runner 700 from Kanye West was introduced in November 2017, following an initial public opening in the Yeezy Season 5 fashion show previously that year. The retro-inspired lines of the sneaker worked together with a chunky silhouette reminiscent of a previous age. A mesh base on the quarter panel is completed in gray and a yellow with a teal forefoot.'),('B75807/BZ0','adidas Samba OG Black White Gum','Adidas','Core Black/Footwear ',9,'U101','https://images.stockx.com/images/adidas-Samba-Black-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2018-06-01','The adidas Samba Black-White Gum shoe, style B75807, is a product made from kangaroo leather with an innovative lightweight upper and gum rubber sole for grip. It features adidas stripes on its sides.\n<br>\n<br>\nOf course, as their name suggests, the shoes are black and cloud-white and come with white or black shoelaces made of polyester and plastic. adidas Samba Black-White Gum’s tongue is branded with the adidas logo. Samba branding is just beneath the collar, close to the stripes on the sides of the sneakers.\n<br>\n<br>\nThe adidas Samba OG Black White Gum was originally released on January 6, 2018 at a retail price of $80, and now sits at a retail price of $100.'),('BD7633','adidas Handball Spezial Navy Gum','Adidas','Navy/Clear Sky/Gum',9,'U101','https://images.stockx.com/images/adidas-Handball-Spezial-Navy-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2020-08-26','The adidas Handball Spezial \'Collegiate Navy Clear Sky\' brings back a 1979 pair crafted for the best handball players. These shoes have a navy suede upper with powder blue touches on the leather three-stripes and back tab. A goldfoil \'Spezial\' is etched on the side panel to highlight the model. Ortholite insoles keep every step light, while a flat gum rubber sole unit keeps you surefooted.'),('BY1604','adidas Yeezy Boost 350 V2 Core Black White','Adidas','Core Black/Core Whit',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Core-Black-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2016-12-17','Featuring a black upper with a white band, SPLY 350 branding, and a translucent black midsole; the Yeezy Boost 350 V2 ‘Oreo’ released on December 17, 2016.'),('BZ0057/B75','adidas Samba OG Cloud White Core Black','Adidas','Cloud White/Core Bla',9,'U101','https://images.stockx.com/images/adidas-Samba-OG-Cloud-White-Core-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2018-01-01','The adidas Samba OG Cloud White Core Black (Women\'s) represents a contemporary take on a timeless style, emanating an aesthetic charm that goes beyond its original athletic purpose.​<br>​​<br>​Crafted from full-grain leather, the upper of the Cloud White Core Black adidas Samba OG (Women\'s) offers a sturdy and resilient construction. A gray suede, paired with a contrasting black heel tab, introduces an element of sophistication to the overall design. The iconic serrated 3-Stripes appear in black on both the lateral and medial sides, creating a visually striking contrast. Enhancing the shoe\'s unique identity, a Bluebird tongue label and a foil logotype mark its distinctive DNA. Underneath, a brown gum rubber outsole ensures both traction and durability, underscoring the shoe\'s practicality and style.​<br>​​<br>​The standout characteristic of the adidas Samba OG Cloud White Core Black (Women\'s) lies in its signature T-toe design. This element pays homage to football pitches of the past, while embracing a forward-looking approach with its entirely vegan composition. The shoe debuted for $100 on December 1st, 2023.'),('CD2563-101','Nike SB Dunk Low Pro White Gum','Nike','White/Black/White/Gu',9,'U101','https://images.stockx.com/images/Nike-SB-Dunk-Low-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-03-01','No description available'),('CD6404-100','Nike P-6000 Triple White','Nike','White/White/White',9,'U101','https://images.stockx.com/images/Nike-P-6000-Triple-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2019-06-17','No description available'),('CN0149-001','Nike P-6000 Metallic Silver','Nike','Metallic Silver/Sail',9,'U101','https://images.stockx.com/images/Nike-P-6000-Metallic-Silver-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-10-06','The Nike P-6000 \'Metallic Silver\' brings a silver mesh upper with chrome-colored synthetic leather overlays. A floating Swoosh is piped in black. The full-length foam midsole works with a black rubber, herringbone-patterned outsole.'),('CP9652','adidas Yeezy Boost 350 V2 Black Red','Adidas','Core Black/Core Blac',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Core-Black-Red-2017-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2017-02-11','The Yeezy Boost 350 V2 \'Bred\' brings a classic colorway to its minimalist construction. The shoe\'s upper is built with Primeknit, finished in black and highlighted by the SPLY-350 branding on the side wall. More red marks the heel pull-loop, while rope laces secure the fit. Underfoot, a full-length Boost midsole wrapped in a black rubber cage provides cushioning. A rubber outsole with cutouts provides traction.'),('CP9654','adidas Yeezy Boost 350 V2 Zebra','Adidas','White/Core Black/Red',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Zebra-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2017-02-25','The Yeezy Boost 350 V2 \'Zebra\' released on February 25, 2017, combining an upper white / core black Primeknit with a red SPLY 350 branding and a full-length translucent midsole boost. On November 16, 2018, a restock of the \' Zebra \' arrived, with more pairs hitting the marketplace and building on Kanye\'s commitment to make Yeezy more available to anyone who wished to acquire them.'),('CT8012-005','Jordan 11 Retro Cool Grey (2021)','Jordan','Medium Grey/Multi-Co',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-Cool-Grey-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-12-11','Released in December 2021, the Air Jordan 11 Retro \'Cool Grey\' 2021 brings back a colorway from 2001 and 2010. Faithful to the OG, the shoe\'s upper is built with leather, finished in grey and supported by a darker grey patent leather mudguard. Tonal webbing eyelets are worked into the lacing system to secure the fit, while underfoot, a contrasting white phylon midsole houses full-length Air for cushioning, with a carbon fiber plate included for added support. An icy translucent rubber outsole provides traction.'),('CT8012-104','Jordan 11 Retro Legend Blue (2024)','Jordan','White/Legend Blue/Bl',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-Legend-Blue-2024-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-12-14','Originally released in 1996, the 2024 edition of the Air Jordan 11 Retro \'Legend Blue / Columbia\' sports a white leather upper, accented with a matching patent leather mudguard and contrasted with a Columbia Blue embroidered Jumpman right below the collar. Bold black accents are carefully-placed in the back tab and collar lining. A white Phylon midsole partners with an Air-sole unit to bring you a lightweight feel underfoot. An icy, see-through rubber outsole showcases a carbon fiber shank plate to keep the midfoot stable.'),('CT8012-116','Jordan 11 Retro Cherry (2022)','Jordan','White/Varsity Red/Bl',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-Cherry-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-12-10','A new entry in the lineage of the Air Jordan 11, the \'Cherry\' also known as \'Varsity Red\' features a clean colorway that utilizes a Chicago Bulls inspired palette. The upper features white mesh with tonal webbing eyelets, while a shiny patent leather mudguard wraps around the entire shoe in a deep red hue. A red Jumpman logo appears on the back heel area, while a translucent rubber outsole finishes the look. A lightweight Phylon midsole provides cushioning while a carbon fiber spring plate offers structural support underfoot.'),('CT8012-170','Jordan 11 Retro DMP Gratitude (2023)','Jordan','Black/White/Metallic',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-DMP-Defining-Moments-2023-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-12-09','Originally released in 2006, the \'Defining Moments Pack\', also known as \'DMP\', paired the AJ6 and AJ11 into a special release. Celebrating championship silhouettes that MJ wore, both shoes feature OG color blocking with gold accents. The 2023 iteration of the Air Jordan 11 Retro \'Gratitude\' returns based on the original \'Concord\' colorway. Featuring a white tumbled leather upper and a black patent leather rand around the shoe, Metallic Gold accents can be found on the embossed Jumpman logo on the heel and \'23\' stamped on the back. A Phylon midsole with Nike Air cushioning combines a carbon fiber shank plate and a clear rubber outsole.'),('CT8013-002','Jordan 12 Retro Flu Game (2025)','Jordan','Black/Varsity Red',9,'U101','https://images.stockx.com/images/Air-Jordan-12-Retro-Flu-Game-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740684335','2025-03-01','The 2025 edition of the Air Jordan 12 Retro \'Flu Game\' brings back the model MJ wore during the infamous Game 5 of the 1997 NBA Finals. Stitch lines adorn the black tumbled leather upper, contrasted by red lizard-textured overlays. The Jumpman emblem decorates the tongue and heel tab. A lightweight Phylon midsole packs a full-length Zoom Air unit for a plush feel. The red rubber outsole uses black herringbone pods for traction and an exposed carbon fiber shank plate for stability.'),('CT8013-112','Jordan 12 Retro Melo (2025)','Jordan','White/University Blu',9,'U101','https://images.stockx.com/images/Air-Jordan-12-Retro-Melo-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746307352','2025-05-17','The 2025 edition of the Air Jordan 12 Retro \'Melo\' celebrates Carmelo Anthony\'s time with the Denver Nuggets, keeping true to the 2004 original with a white leather upper, radiating stitched lines and a lizard-textured mudguard. University Blue touches adorn the collar lining, pull tab and rubber outsole, which contains an exposed carbon fiber shank plate for stability and herringbone pods for traction.'),('CT8529-112','Jordan 6 Retro Reverse Oreo','Jordan','White/Black',9,'U101','https://images.stockx.com/images/Air-Jordan-6-Retro-Reverse-Oreo-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-06-08','The Air Jordan 6 Retro \'Reverse Oreo\' rocks a white leather upper with perforations throughout the midfoot and collar areas. A black two-hole tongue and a matching, speckled heel tab provide bold contrast. The Jumpman logo adorns the neoprene lace cover and back heel. White speckles land once again on the black midsole, equipped with an Air-sole heel unit and anchored by a see-through rubber outsole.'),('CT8529-164','Jordan 6 Retro Olympic (2024)','Jordan','White/Varsity Red/Mi',9,'U101','https://images.stockx.com/images/Air-Jordan-6-Retro-Olympic-2024-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-08-03','Honoring the uniforms Team USA wore during the 2000 Sydney Olympics, the 2024 version of the Air Jordan 6 Retro \'Olympic\' sports a navy tumbled leather upper with contrasting white overlays. Red Jumpman logos appear on the lace guard and the back of the heel, completing the red, white and blue colorway. Traditional details like the molded two-hole tongue, lace locks and a spoiler-like pull tab remain intact. A lightweight foam midsole equips an exposed Air-sole heel unit, anchored by a see-through rubber outsole for steady traction on and off the court.'),('CT8532-001','Jordan 3 Retro Black Cat (2025)','Jordan','Black/Dark Charcoal/',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-Black-Cat-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2025-01-11','The 2025 version of the Air Jordan 3 Retro \'Black Cat\' was named after one of Michael Jordan\'s pre-NBA nicknames. Sporting black nubuck on the upper, these shoes have a matching black patent leather mudguard and charcoal elephant-print forefoot and heel overlays. The Jumpman logo graces the tongue and back tab, while a foam midsole contains a visible Air-sole heel unit for a resilient feel.'),('CT8532-031','Jordan 3 Retro Green Glow','Jordan','Black/Green Glow/Wol',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-Green-Glow-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-03-16','The Air Jordan 3 Retro ‘Green Glow’ throws a splash of color into a design inspired by the OG ‘Black Cement’ colorway. These shoes have a black leather upper with elephant print overlays on the eyestay, toe cap and heel. Green pops on the upper and lower eyelets add a touch of contrast, coupled with a raised Jumpman logo on the back tab. A soft midsole pairs with an Air-sole heel unit for a lightweight feel.'),('CT8532-101','Jordan 3 Retro Lucky Shorts','Jordan','Summit White/Hydroge',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-Lucky-Shorts-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738777785','2025-02-22','The Air Jordan 3 Retro \'Lucky Shorts\' shoes take cues from the UNC shorts Michael Jordan wore underneath his Chicago Bulls uniform. A white tumbled leather upper gets complementing grey suede forefoot and heel overlays. Powder blue eyelets match the Jumpman logos on the tongue and heel tab. More blue engulfs the heel of the off-white midsole, which contains an Air-sole united backed by a grey rubber outsole underfoot.'),('CT8532-106','Jordan 3 Retro Cement Grey','Jordan','Summit White/Fire Re',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-Cement-Grey-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-08-31','The Air Jordan 3 Retro \'Cement Grey\' rocks white tumbled leather on the upper, accented with a dark grey elephant print on the eyestay and forefoot and heel overlay. A red Jumpman logo decortes the tongue and heel tab. The foam midsole partners with an encapsulated Air-sole forefoot unit and a visible Air bag heel unit for all-around cushioning.'),('CU9225-001','Nike Air Force 1 Low Supreme Black','Nike','Black/Black-Black',9,'U101','https://images.stockx.com/images/Nike-Air-Force-1-Low-Supreme-Box-Logo-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2020-03-05','Originally debuting as part of Supreme\'s Spring/Summer 2020 collection, the Supreme x Air Force 1 Low \'Box Logo - Black\' released in March 2020. The shoe\'s full-grain leather upper appears in black, accented by Supreme\'s red box logo on the lateral heel. The custom sockliner and additional set of laces sport further Supreme branding, while the midsole houses the usual Air for cushioning.'),('CU9225-100','Nike Air Force 1 Low Supreme White','Nike','White/White-White',9,'U101','https://images.stockx.com/images/Nike-Air-Force-1-Low-Supreme-Box-Logo-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2020-03-05','The Supreme x Air Force 1 Low \'Box Logo - White\' released as part of the New York brand\'s Spring/Summer 2020 collection. The shoe\'s upper is built with leather, finished in white and highlighted by Supreme\'s signature box logo on the lateral heel. The custom sockliner and a second set of laces sport further Supreme branding, while Air in the heel of the midsole provides cushioning.'),('CW1590-100','Nike Dunk Low Retro White Black Panda (GS)','Nike','White/Black-White',9,'U101','https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-03-10','The Dunk Low GS \'Black White\' brings a classic two-tone colorway to the basketball classic. A grade-school iteration of the shoe, the upper appears in a mix of black and white on its leather construction, with a lightly padded tongue for support. Underfoot, a white low-profile midsole gives way to a concentric black rubber outsole, which takes its traction pattern from the Air Jordan 1.'),('CW2190-400','Nike Kobe 6 Protro Dodgers','Nike','Game Royal/White-Uni',9,'U101','https://images.stockx.com/images/Nike-Kobe-8-Protro-Dodgers-PE-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1744390857','2025-05-30','The Nike Zoom Kobe 6 Protro \'Dodgers\' uses a bold royal blue upper to celebrate the MLB franchise, making use of \'islands\' that create an eye-catching snakeskin texture. A white printed Swoosh graces the side panel, matching the heel cage and Kobe Bryant\'s shield logo on the tongue. The latter is touched with red baseball-style stitching, while a crimson \'8\' is embossed on the heel. A lightweight Cushlon midsole packs Zoom Air cushioning in the forefoot for a propulsive feel.'),('CZ0175‌-‌0','Nike Air Zoom GT Cut Think Pink','Nike','Pure Platinum/Regal ',9,'U101','https://images.stockx.com/images/Nike-Air-Zoom-GT-Cut-Think-Pink-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-02-22','The Nike Air Zoom G.T. Cut Think Pink has been created in partnership with the Kay Yow Cancer Fund in support of Breast Cancer Awareness.\n<br>\n<br>\nThe Think Pink colorway of the Nike Air Zoom G.T. Cut sports breathable open white mesh weave over nylon panels ranging from pink to white. A multicolored Swoosh outline adorns the lateral side panel, along with a bright pink mud guard with a white swirl. The tongue, laces, sock liner, and insoles are all white. The heel counter is white with bright pink speckles and a bright pink streak. The midsole is Nike React white foam with a visible Air unit and an Air Zoom Strobel, complete with branding you can see through the outsole of translucent white rubber.\n<br>\n<br>\nOur sneaker experts love the Kay Yow branding and logo on the heels. The Nike Air Zoom G.T. Cut Think Pink was released on February 22, 2022, for a price of $170.'),('CZ0790-102','Jordan 1 Retro Low OG Mocha','Jordan','White/Black-Dark Moc',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-Mocha-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-09-21','The Air Jordan 1 Retro Low OG \'Mocha\' sports a white leather upper with bold black accents on the forefoot and signature Swoosh. Brown nubuck touches the heel overlay and back tab, stamped with a black Wings logo. The Nike Air logo appears on the tongue tag and insoles. An off-white midsole equips an encapsulated Air-sole unit, anchored by a black rubber outsole.'),('CZ0790-107','Jordan 1 Low OG Rookie of the Year','Jordan','Sail/Black-Golden Ha',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Low-OG-Rookie-of-the-Year-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2025-04-18','The Air Jordan 1 Retro Low OG \'Rookie of the Year\' takes cues from the 2018 AJ1 High of the same name. Inspired by the outfit Michael Jordan wore during his Rookie of the Year acceptance speech in 1985, these shoes have a white and tan leather upper. A black Wings logo adorns the back tab, matching the Swoosh on the side panel and the collar lining. A red-on-black Nike Air tag adorns the tongue, while the rubber cupsole contains an encapsulated Air-sole unit for a soft feel.'),('CZ0790-110','Jordan 1 Retro Low OG Barons','Jordan','White/Black-Wolf Gre',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-Barons-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-07-20','Commemorating the 30th anniversary of Michael Jordan\'s venture with the Chicago White Sox Double-A minor league affiliate, the Air Jordan 1 Retro Low OG \'Barons\' rocks a white leather upper with grey overlays on the forefoot and heel. Black leather accents hit the Swoosh and back tab, stamped with the iconic Wings logo. A classic rubber cupsole is equipped with an encapsulated Air-sole heel unit to cushion every step.'),('CZ0790-400','Jordan 1 Low OG Obsidian UNC','Jordan','Obsidian/University ',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Low-OG-Obsidian-UNC-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1741202496','2025-03-29','The Air Jordan 1 Retro Low OG \'Obsidian UNC\' has a white leather upper with dark navy accents on the Swoosh, eyestay and forefoot overlay. In honor of Michael Jordan\'s alma mater, Carolina blue engulfs the heel overlay and Wings-branded back tab. A traditional rubber cupsole gets stitched sidewalls and Air-sole cushioning on the heel for a responsive feel.'),('CZ7871-001','Nike Air Max 2 CB \'94 Black White Purple','Nike','Black/White-Pure Pur',9,'U101','https://images.stockx.com/images/Nike-Air-Max-2-CB-94-Black-White-Purple-2020-Product.png?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2020-08-01','The 2025 version of the Nike Air Max 2 CB 94 Retro \'Black Purple\' brings back the exact colorway Charles Barkley wore during the 1993-94 season. These sneakers have a white leather upper tooled with black nubuck overlays and contrasting purple touches on the mesh tongue and inner bootie. A rubberized Air Max 2 patch lands on the tongue, while the Nike Air logo decorates the heel. The black foam midsole contains a visible Max Air unit in the heel.'),('CZ8065-100','Nike Air Force 1 Low Drake NOCTA Certified Lover B','Nike','White/White-Cobalt T',9,'U101','https://images.stockx.com/images/Nike-Air-Force-1-Low-Drake-Certified-Lover-Boy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-12-08','Drake-inspired details imbue the NOCTA x Nike Air Force 1 Low ‘Certified Lover Boy’, an understated version of the unmistakable white-on-white AF1 colorway. Asymetric NOCTA and Nike Air branding on each heel tab ornament the white tumbled leather upper, with a nod to heritage details with a perforated toe box, variable width lacing and a low-cut padded collar. Drake\'s final wink is ‘Love You Forever’ inscribed in embossed lettering across the lateral sidewall of its white midsole, giving this classic a 2022 twist'),('DA6672-200','NikeCraft General Purpose Shoe Tom Sachs','Nike','Light Cream/White-Li',9,'U101','https://images.stockx.com/images/NikeCraft-General-Purpose-Shoe-Tom-Sachs-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-06-10','Embracing the idea that footwear can be valued just for its function, the Tom Sachs x NikeCraft General Purpose Shoe ‘Studio’ is marketed as a sneaker for everyday wear. The classic simplicity of the shoe is delivered via a knit upper in cream with overlays in a contrasting off-white suede. The signature Swoosh appears in a subtle print while pull tabs on the tongue and at the heel provide an unexpected shock of brilliant royal blue. A molded cupsole with an EVA core, gum rubber sidewalls and a rubber outsole with waffle traction offers support and grip for all-day wear.'),('DD1391-100','Nike Dunk Low Retro White Black Panda','Nike','White/Black',9,'U101','https://images.stockx.com/images/Nike-Dunk-Low-Retro-White-Black-2021-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-03-10','The Dunk Low \'Black White\' also known as \'Panda\' brings a classic two-tone look to its classic basketball construction. The shoe\'s low-top build emerges in leather, with a white base contrasted by black overlays, with further black on the Swoosh branding. Perforations on the toe box provide breathability, while underfoot, the two-tone look is matched by the tooling, which incorporates a concentric rubber outsole for traction.'),('DD1391-103','Nike Dunk Low Grey Fog','Nike','White/Grey Fog',9,'U101','https://images.stockx.com/images/Nike-Dunk-Low-Grey-Fog-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-09-21','Delivering a subtle two-tone colorway of the classic silhouette originally released in 1985 is the Nike Dunk Low \'Grey Fog\'. The all-leather upper features a white base with contrasting overlays in a light grey shade. The Swoosh, laces, and woven Nike tongue tag are in the same neutral tone. Additional Nike branding is on the heel tab and padded sockliner. On the bottom is a standard rubber cupsole that pairs white sidewalls with a grey rubber outsole.'),('DD1503-101','Nike Dunk Low Retro White Black Panda (Women\'s)','Nike','White/Black',9,'U101','https://images.stockx.com/images/Nike-Dunk-Low-White-Black-2021-W-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-03-10','A women\'s shoe, the Wmns Dunk Low \'Black White\' also known as ‘Panda’ emerges with a classic two-tone look. Built entirely with leather, the shoe\'s upper sports a white base overlaid by black, with black also marking the Swoosh branding. Perforations on the toe box provide breathability, while white branding appears on the tongue and heel patch. Underfoot, the two-tone rubber cupsole includes a concentric outsole to provide traction.'),('DH6927-017','Jordan 4 Retro Thunder (2023)','Jordan','Black/Tour Yellow',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Thunder-2023-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-05-13','The 2023 Air Jordan 4 Retro \'Thunder\' reintroduces the popular color scheme that was first released in 2006 and later reissued in 2012. The shoe\'s upper appears in all-black nubuck with yellow accents on the molded eyelets, lower tongue and quarter panel, the latter two draped with black netting. Cushioned comfort underfoot is supplied by a yellow PU midsole and is enhanced by the heel’s exposed Air-sole unit. The Flight tongue tag and molded heel tab bear the iconic Jumpman branding.'),('DH6927-161','Jordan 4 Retro Red Cement','Jordan','White/Fire Red/Black',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Red-Cement-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-09-09','The Air Jordan 4 Retro ‘Red Cement’ is a midtop delivered in a color scheme reminiscent of the original ‘White Cement’ model, with a white leather upper with black accents on the lining and molded eyelets. Fire Red accents with black speckling adorn the support wings, heel tab and midsole. The heel displays an embossed Jumpman logo, and a second Jumpman appears on the tongue tag. The herringbone-patterned rubber outsole provides excellent grip on the court.'),('DM7866-200','Jordan 1 Retro Low OG SP Travis Scott Medium Olive','Jordan','Medium Olive/Black/S',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-SP-Medium-Olive-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1741099152','2024-09-28','The Travis Scott x Jordan 1 Retro Low OG SP \'Reverse Olive / Medium Olive\' dons a green suede base with chalk white leather overlays on the forefoot and heel areas. Scott\'s black tumbled leather reverse Swoosh adorns the side, while red pops touch the Nike Air tongue as well as the Wings and Cactus Jack logos on the back tab. These sneakers have an off-white midsole, reinforced by a sturdy olive rubber outsole.'),('DM7866-202','Jordan 1 Retro Low OG SP Travis Scott Velvet Brown','Jordan','Dark Mocha/Black/Vel',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-SP-Travis-Scott-Velvet-Brown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-12-21','Travis Scott\'s signature reverse Swoosh stands out on the Air Jordan 1 Retro Low OG SP \'Velvet Brown\', featuring a black tumbled leather upper with suede upper touches throughout. The brown nylon tongue gets a Nike Air tag, while mismatched Cactus Jack and Wings logos land on each back tab. A brown rubber cupsole gets stitched sidewalls and an encapsulated Air-sole heel unit for a plush sensation underfoot.'),('DN3707-010','Jordan 3 Retro OG Black Cement (2024)','Jordan','Black/Fire Red/Cemen',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-Black-Cement-Reimagined-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-23','The 2024 version of the Air Jordan 3 Retro OG \'Black Cement\' stays true to the 1988 original, rolling out a black tumbled leather upper with grey elephant print forefoot and heel overlays. An embroidered red Jumpman stars on the tongue, while a raised Nike Air logo adorns the heel. A white foam midsole equips Air-sole cushioning, adding a touch of black along the heel, anchored by a grey rubber outsole.'),('DN3707-100','Jordan 3 Retro White Cement Reimagined','Jordan','Summit White/Fire Re',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-White-Cement-Reimagined-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-03-11','Commemorating 35 years of a classic silhouette, the Air Jordan 3 Retro \'White Cement Reimagined\' marks the return of an original colorway and duplicating the build of the original 1988 model. The upper combines white leather with overlays on the heel and toe in the trademark elephant print that designer Tinker Hatfield introduced, with Varsity Red pops on the tongue’s Jumpman branding and the lace loops. Additional branding appears on the heel tab with ‘Nike Air.’ Comfort underfoot is ensured by a visible Air-sole unit and the back heel and midsole are imbued with an aged yellow tint to showcase a vintage look.'),('DR5415-100','Jordan 4 Retro SB Navy','Jordan','Summit White/White/N',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-SB-Navy-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1740411181','2025-03-18','The Nike SB x Air Jordan 4 Retro SP \'Navy\' sports a white leather upper with a grey suede forefoot overlay and side panel netting. A red Jumpman embellishes the tongue, while an embossed Nike SB logo adorns the navy heel tab. More navy accents decorate the eyelets and foam midsole, which showcases a visible Nike Air unit in the heel. A herringbone-patterned outsole uses gum rubber in high-wear areas for enhanced durability.'),('DV0833-113','Nike Dunk Low Retro University Blue','Nike','University Blue/Coco',9,'U101','https://images.stockx.com/images/Nike-Dunk-Low-Retro-University-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-10-01','The Nike Dunk Low \'University Blue Coconut Milk\' is decked out with an off-white leather upper, powder blue overlays and a matching Swoosh. A nylon tongue and perforated details on the toe box keep the OG details intact. A rubber cupsole gets white sidewalls and a blue rubber outsole for smooth traction.'),('DV1309-100','Jordan 1 Low SE Concord','Jordan','White/Black',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Low-SE-Concord-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-01-17','No description available'),('DV1748-601','Jordan 1 Retro High OG Spider-Man Across the Spide','Jordan','University Red/Black',9,'U101','https://images.stockx.com/images/Air-Jordan-1-High-OG-Spider-Man-Across-the-Spider-Verse-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-05-20','The Marvel x Air Jordan 1 Retro High OG ‘Next Chapter\' is a collaboration whose colorway is inspired by the animated film \'Spider-Man: Across the Spider-Verse.’ This version of the iconic sneaker model is a creative twist on the classic ‘Chicago’ colorway, with a white leather upper and black patent leather on the signature Swoosh and collar. The scarlet overlays are a combination of various textures and prints, pieced together to create a unique design that references the complex nature of the Spiderman universe. The shoe is supported by a rubber cupsole that combines aged sidewalls with a crimson semi-clear rubber outsole. A Nike tag made of woven nylon decorates the tongue while the retro Wings logo is stamped on the lateral collar flap.'),('DX9786-699','Nike Hoops Elite Backpack (32L) Elemental Pink/Bla','Nike','Elemental Pink/Black',9,'U101','https://images.stockx.com/images/Nike-Hoops-Elite-Backpack-32L-Elemental-Pink-Black-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746645338','2000-01-01','The Nike Hoops Elite Backpack (32L) in Elemental Pink/Black/Black is a stylish and functional accessory designed for athletes and everyday users alike. This spacious backpack features a 32-liter capacity, providing ample room for all your essentials. The striking Elemental Pink color, accented with black details, offers a bold and eye-catching look that stands out from the crowd. Crafted with Nike\'s renowned quality, this backpack is built to withstand the rigors of daily use, whether you\'re heading to the gym, school, or a weekend getaway.<br><br>Equipped with multiple compartments and pockets, the Nike Hoops Elite Backpack allows for efficient organization of your belongings. The main compartment is spacious enough to hold your gear, while additional pockets provide easy access to smaller items like your phone, keys, or water bottle. The padded shoulder straps and back panel ensure comfort during extended wear, making it ideal for those always on the move. With its durable construction and sleek design, this backpack seamlessly blends style and functionality for the modern individual.<br><br>Our team thinks this product is great for athletes and students who need a reliable, spacious backpack that can keep up with their active lifestyle while making a fashion statement.'),('DZ4137-700','Jordan 1 Retro Low OG SP Travis Scott Canary (Wome','Jordan','Canary/Racer Blue/Li',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Retro-Low-OG-SP-Travis-Scott-Canary-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','