r-Jordan-4-Retro-White-Thunder-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-08-24','The Air Jordan 4 Retro GS \'White Thunder\' keeps the same coloring from the 2006 \'Thunder\' release. This grade school version has a black nubuck upper with contrasting white accents on the mesh side panel, overlaid with black netting, and molded eyelets. A white Jumpman icon lands on the tongue and heel. A matching white midsole packs an exposed Air-sole unit for a plush feel.'),('FQ8213-006','Jordan 4 Retro Bred Reimagined (GS)','Jordan','Black/Cement Grey/Va',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Bred-Reimagined-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-02-17','The Air Jordan 4 Retro GS \'Bred Reimagined\' refreshes the iconic silhouette with a black leather upper instead of the original’s nubuck construction. Classic elements appear via the textile lining and molded eyelets with Cement Grey accents. The heel tab displays OG Nike Air branding, and a crimson Jumpman logo adorns the woven Flight tongue tag. The PU midsole has a visible Air-sole unit in the heel for added comfort.'),('FV4710-100','Nike Air Max 95 Hyper Turquoise','Nike','White/Hyper Turquois',9,'U101','https://images.stockx.com/images/Nike-Air-Max-95-Hyper-Turquoise-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-01-15','No description available'),('FV4921-600','Nike Kobe 6 Protro Reverse Grinch','Nike','Bright Crimson/Black',9,'U101','https://images.stockx.com/images/Nike-Kobe-6-Protro-Reverse-Grinch-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-12-15','Presenting a color-flipped rendition of the renowned 2010 \'Grinch\' color scheme, the Nike Zoom Kobe 6 Protro \'Reverse Grinch\' delivers its scaly micro-mesh upper in a vivid crimson shade, highlighted by a bold black Swoosh and fastened with neon green laces. A padded low-cut collar and molded TPU heel counter ensure comfort and stability. A Cushlon midsole along with a responsive forefoot Zoom Air unit provide lightweight cushioning.'),('FV5029-006','Jordan 4 Retro Bred Reimagined','Jordan','Black/Cement Grey/Va',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Bred-Reimagined-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-02-17','The Air Jordan 4 Retro \'Bred Reimagined\' is a new iteration of the iconic design which replaces the original 1989 release\'s nubuck material with a black leather upper. Quarter panel netting, gray molded eyelets, and Nike Air branding on the heel tab are heritage details, and a crimson Jumpman logo adorns the woven Flight tongue tag. The PU midsole features encapsulated Air-sole cushioning in the forefoot and an exposed Air unit in the heel, resting on a pre-distressed rubber outsole with a herringbone traction pattern.'),('FV5029-100','Jordan 4 Retro White Cement (2025)','Jordan','Summit White/Fire Re',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-White-Cement-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1743628198','2025-05-24','The 2025 version of the Air Jordan 4 Retro OG \'White Cement\' carries a layered white leather upper tooled with the signature quarter panel netting and black molded eyelets. The support wings are painted in grey, decorated with black speckles, matching the Air-assisted foam midsole, and Nike-branded heel tab. The red Jumpman logo matches the Flight-branded tongue tag. The rubber outsole has key flex grooves for a comfortable sensation and a herringbone pattern for smooth traction.'),('FV5029-141','Jordan 4 Retro Military Blue (2024)','Jordan','Off-White/Military B',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-Military-Blue-2024-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-05-04','Bringing back a classic OG colorway, the 2024 version of the Jordan 4 Retro \'Military Blue\' also known as \'Industrial Blue\' returns with an off-white leather upper and nubuck forefoot overlays. The blue Jumpman logo decorates the tongue tag, matching the color of the molded eyelets, back tab and the underneath of the side panel netting. These shoes have a lightweight midsole with an encapsulated Air-sole forefoot unit and a visible Air bag in the heel.'),('FV5104-006','Jordan 11 Retro Low Bred (2025)','Jordan','Black/White-Varsity ',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-Low-Bred-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1744933373','2025-04-26','The 2025 edition of the Air Jordan 11 Retro Low \'Bred\' carries a black ballistic mesh upper with a matching patent leather mudguard. A small Jumpman logo decorates the black leather back tab, while \'Jumpman\' and \'Jordan\' are etched across the tongue. Full-length Air-sole cushioning couples with a white Phylon midsole, anchored by a see-through rubber outsole and a carbon fiber spring plate for stability.'),('FV5121-006','Jordan 11 Retro Low Bred (GS) (2025)','Jordan','Black/White-Varsity ',9,'U101','https://images.stockx.com/images/Air-Jordan-11-Retro-Low-Bred-2025-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1743702361','2025-04-26','The Air Jordan 11 Retro Low GS \'Bred\' 2025 brings back the classic Chicago Bulls-based colorway, starting with a black ballistic mesh upper, secured with rope laces that feed through webbed eyelets. A shiny patent leather mudguard bolsters the design, which rides on a white Phylon midsole, aided by full-length Air-sole cushioning and a carbon fiber shank plate. A see-through red rubber outsole uses herringbone pods for better traction.'),('FV5677','adidas Yeezy Desert Boot Salt','Adidas','Salt/Salt/Salt',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Desert-Boot-Salt-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2019-09-14','The Yeezy Desert Boot \'Salt\' dropped in September 2019 alongside accompanying colorways in ‘Rock’ and ‘Oil.’ This pair features a monochromatic pale grey finish, executed on an upper that combines breathable mesh with nubuck and suede overlays. A reflective pull tab runs down the length of the padded mesh tongue. Underfoot, a lugged rubber outsole is good for durable traction.'),('FZ1291-600','Nike SB Dunk Low The Wizard of Oz Poppy Field','Nike','Varsity Red/Universi',9,'U101','https://images.stockx.com/images/Nike-SB-Dunk-Low-The-Wizard-of-Oz-Poppy-Field-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-12-23','The Wizard of Oz x Nike Dunk Low SB \'Poppy Field\' nods to the classic 1939 film. Red satin lines the upper, which is wrapped in a poppy field of Oz allover print. The silky top layer is made to be torn away, revealing a red suede surface, mirroring Dorothy\'s ruby slippers. The Nike SB and \'The Wizard of Oz\' logos star on the tongue, while \'No place like home\' is stitched on the heel. Nike SB-branded insoles depict the Wicked Witch of the West with one of her flying monkeys. The lively poppy print extends to the midsole, anchored by a red rubber outsole underfoot.'),('FZ1518-600','Nike KD 17 NRG Aunt Pearl','Nike','Pink Foam/Beyond Pin',9,'U101','https://images.stockx.com/images/Nike-KD-17-Aunt-Pearl-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-15','The Nike KD 17 NRG Aunt Pearl commemorates Kevin Durant\'s late aunt with its meaningful design and striking aesthetics. This edition continues the tradition of blending basketball performance with heartfelt storytelling, and combines unique materials and design elements in an unforgettable silhouette.\n<br>\n<br>\nAunt Pearl\'s version of the KD 17 NRG by Nike features a predominantly pink foam textile upper, accented with iridescent \"KD\" branding on the tongue and heel. Embroidered details on the heel overlay add depth and symbolize the emotional connection behind the design. The midsole integrates responsive Zoom Air cushioning in the forefoot, complemented by an Air Strobel unit in the heel. This shoe was introduced to honor Durant\'s aunt and raise awareness for cancer research.\n<br>\n<br>\nOne thing we love about the Nike KD 17 NRG Aunt Pearl is its intricate embroidery that honors Kevin Durant’s family legacy. Additionally, the cushioning system blends advanced Zoom Air and Air Strobel technology, which offers impressive performance. Released on 15th November 2024, this heartfelt design retailed at $150.'),('FZ4810-200','Jordan 4 Retro OG SP A Ma Maniére While You Were S','Jordan','Fossil Stone/Metalli',9,'U101','https://images.stockx.com/images/Air-Jordan-4-Retro-OG-SP-A-Ma-Maniere-While-You-Were-Sleeping-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-09-20','The A Ma Maniére x Women\'s Air Jordan 4 Retro \'While You Were Sleeping\' takes a grey leather upper and adds matching suede forefoot overlays and a deconstructed knit collar. Iconic details like the quarter-panel netting, molded eyelets and prominent support wings are kept intact. The Jumpman and A Ma Maniére logos take turns on each tongue tag, while a raised Nike Air logo graces the heel. A two-tone midsole boasts an exposed Air-sole heel unit for a plush feel underfoot.'),('FZ4811-001','Jordan 3 Retro OG SP A Ma Maniére While You Were S','Jordan','Black/Black/Flat Pew',9,'U101','https://images.stockx.com/images/Air-Jordan-3-Retro-OG-SP-A-Ma-Maniere-Black-Violet-Ore-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-08-20','The A Ma Maniére x Women\'s Air Jordan 3 Retro \'While You Were Sleeping\' mixes a black tumbled leather upper with grey hairy suede forefoot and heel overlays. Perforated violet ore nubuck hits adorn the eyestay and quilted satin-lined collar, which is stripped of padding. A slimmed down tongue alternates the luxury brand\'s \'A\' logo next to the iconic Jumpman logo, while a raised Nike Air logo graces the heel tab. A vintage off-white foam midsole packs an exposed Air-sole heel unit for a plush feel underfoot.'),('FZ5896','adidas Yeezy Slide Flax','Adidas','Flax/Flax/Flax',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Slide-Flax-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-03-20','The \'Flax\' colorway of the Yeezy Slide sees the one-piece sandal arrive in a monochromatic dark beige hue. The entire shoe is made with injected EVA, making it lightweight, durable and comfortable. The outsole features a series of horizontal grooves, placed for optimal impact protection and traction.'),('FZ5897','adidas Yeezy Slide Bone (2022/2023 Restock)','Adidas','Bone/Bone/Bone',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Slide-Bone-2022-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-05-31','First released in 2019, the 2022 release of the Yeezy Slide \'Bone\' brings back a neutral colorway of the minimalist sandal. A light ivory color permeates the one-piece slide, manufactured from injection-molded EVA for lightweight durability. The outsole features a set of grooves for traction, while a small adidas logo can be found on the footbed.'),('FZ7333-002','Nike Kobe 9 EM Low Protro Mambacita','Nike','Black/Metallic Gold/',9,'U101','https://images.stockx.com/images/nike-kobe-9-em-low-protro-gift-of-mamba.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1744983556','2025-05-01','The Nike Kobe 9 EM Protro \'Mambacita\' pays tribute to Gigi Bryant. The engineered mesh upper features a grey and black fade with a metallic gold Swoosh. Gold accents the \'Gigi\' callout on the back heel, as well as a Kobe sheath logo on the tongue. Flywire cables are built into the lacing system for a lockdown feel. These shoes have a marbled midsole that houses a drop-in React foam midsole, replacing the Lunarlon cushioning from the OG.'),('FZ8117-102','Jordan Jumpman Jack TR Travis Scott Bright Cactus','Jordan','Muslin/Black/Bright ',9,'U101','https://images.stockx.com/images/Air-Jordan-Jumpman-Jack-TR-Travis-Scott-Muslin-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1747343262','2025-04-30','The Travis Scott x Jordan Jumpman Jack TR \'Bright Cactus\' has a neon green canvas upper with off-white tumbled leather overlays. A contrasting black Swoosh matches the collar and tongue, which is stamped with a Jumpman \'Crown\' logo. \'TS\' is embroidered on the forefoot strap, while a signature Cactus Jack smiley graphic graces the heel area. A Phylon midsole works with a rubber outsole underfoot to complete the look.'),('FZ8117-204','Jordan Jumpman Jack TR Travis Scott Dark Mocha','Jordan','Dark Mocha/Black-Sai',9,'U101','https://images.stockx.com/images/Air-Jordan-Cut-The-Check-TR-Travis-Scott-Mocha-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-26','The Travis Scott x Jordan Jumpman Jack TR \'Dark Mocha\' dons La Flame\'s signature reverse Swoosh in black suede, matching the black canvas upper and complementing the brown nubuck overlays. The Jumpman logo adorns the tongue, while the Cactus Jack smiley logo graces the heel area. \'TS\' is embroidered on the adjustable forefoot strap, while an oversized \'Jack\' graphic can be seen on the black rubber outsole. The matching black foam midsole above keeps every step plush and comfortable.'),('FZ8224-100','Nike Air Diamond Turf 49ers (2025)','Nike','White/Fire Red/Black',9,'U101','https://images.stockx.com/images/Nike-Air-Diamond-Turf-49ers-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738866260','2025-01-24','The 2025 edition of the Nike Air Diamond Turf \'49ers\' stays true to the original 1993 release, rocking a white and black leather upper secured with a wide midfoot strap. The latter gets an embossed red Swoosh, which matches the collar lining and the Nike Air logo on the heel. These kicks have a full-length foam midsole with encapsulated Air-sole cushioning underfoot.'),('FZ8605-401','Nike A\'One Indigo Girl (Women\'s)','Nike','Blue Fury/Racer Blue',9,'U101','https://images.stockx.com/images/nike-aone-blue-fury-womens.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746559652','2025-05-15','The Nike Women\'s A\'One \'Indigo Girl\' uses multiple shades of blue on the mesh upper tooled with synthetic leather accents. A pearlized Swoosh adorns the sides, while A\'ja Wilson\'s logo decorates the tongue. These shoes ride on a Cushlon 3.0 foam midsole, housed within a Phylon carrier and a plastic frame bezel for stability.'),('FZ8605-601','Nike A\'ja Wilson A\'One Pink A\'ura (Women\'s)','Nike','Hyper Pink/Laser Pin',9,'U101','https://images.stockx.com/images/Nike-AOne-Pink-Aura-Womens.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1742243289','2025-05-06','No description available'),('GW1229','adidas Yeezy Boost 350 V2 Beluga Reflective','Adidas','Reflective/Steeple G',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Beluga-Reflective-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-12-18','The adidas Yeezy Boost 350 V2 \'Beluga Reflective\' revisits a 2016 colorway, pairing a predominantly grey Primeknit upper with an orange side stripe that features SPLY-350 branding. The knit build is interwoven with reflective fibers that provide enhanced visibility in low-light conditions. A full-length Boost midsole housed in a semi-translucent rubber cage provides support, durability and traction.'),('GY3438','adidas Yeezy Boost 350 V2 Light','Adidas','Light/Light/Light',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Light-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2021-08-28','The Yeezy Boost 350 V2 \'Light\' features a clean colorway with unique detailing. While the shoe\'s upper, built with Primeknit, appears in white, but when exposed to sunlight, the knit construction appears in pink. The monofilament stripe also changes color, turning to amber, while underfoot, the usual tooling provides cushioning, consisting of a full-length Boost midsole wrapped in a rubber cage.'),('GY7164','adidas Yeezy Boost 350 V2 Dazzling Blue','Adidas','Core Black/Dazzling ',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Boost-350-V2-Dazzling-Blue-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-02-26','Delivering a two-tone colorway of Kanye West\'s popular lifestyle runner is the adidas Yeeezy Boost 350 V2 \'Dazzling Blue.\' The minimalist upper is constructed with flexible Primeknit, pitched to a solid black hue with contrasting threads woven throughout. A royal blue streak cuts through the lateral side, complete with signature SPLY-350 branding. Responsive cushioning arrives via a full-length Boost midsole wrapped in a semi-translucent TPU cage.'),('H03665','adidas Yeezy 450 Utility Black','Adidas','Utility Black/Utilit',9,'U101','https://images.stockx.com/images/adidas-Yeezy-450-Utility-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-08-02','The Adidas Yeezy 450 \'Utility Black\' balances its bold design with a sleek, all-black color scheme. The shoe features a lightweight construction with an upper in black knit, fastened with laces and delivering a snug, sock-like cuff. The midsole, made of a black PU material, encases the sides and heel and offers both support and a unique look. The bottom of the shoe provides a contoured outsole with grooves for improved traction.'),('HF1567-200','Jordan 1 Low SE Legend Light Brown','Jordan','Legend Light Brown/S',9,'U101','https://images.stockx.com/images/Air-Jordan-1-Low-SE-Legend-Light-Brown-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-08-20','No description available'),('HF3058-300','Nike SB Dunk Low Rodeo Tourmaline','Nike','Tourmaline/Baroque B',9,'U101','https://images.stockx.com/images/Nike-SB-Dunk-Low-Black-History-Month-2025-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1747343266','2025-05-09','The Dunk Low SB \'Rodeo\',also known as \'Tourmaline\', rolls out a green suede upper secured with braided laces. A black suede Swoosh adorns the side panel, while unique Sonora-style embroidery graces the heel. Orange piping, a yellow knit lining, and an orange leather back tab bring a touch of radiant color. The insoles have custom artwork depicting a cowboy herding cattle. A partially see-through rubber outsole underfoot completes the look.'),('HF3975-001','Jordan 5 Retro OG Black Metallic Reimagined','Jordan','Black/White-Metallic',9,'U101','https://images.stockx.com/images/Air-Jordan-5-Retro-OG-Black-Metallic-Reimagined-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738617131','2025-02-08','The Air Jordan 5 Retro OG \'Black Metallic Reimagined\' sports a black nubuck upper with molded eyelets, its typical si