pr=2&updated_at=1738193358','2024-02-29','Made from a stretchy Primeknit upper, the adidas Yeezy Boost 350 V2 \'Steel Grey\' sports distinct center stitching and a near see-through side stripe. The sock-like build also has a heel pull to make it easy to put on your shoes or take them off. A full-length Boost midsole is wrapped in a ribbed cage that keeps their monochromatic vibe.'),('IF6490','adidas Handball Spezial Earth Strata Gum (Women\'s)','Adidas','Earth Strata/Off Whi',9,'U101','https://images.stockx.com/images/adidas-Handball-Spezial-Earth-Strata-Gum-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-11-10','Brought back from the \'70s archive, the adidas Women\'s Handball Spezial \'Earth Strata Gum\' has an upper crafted from brown hairy suede, contrasted by white leather touches on the back tab and serrated three-stripes. Synthetic leather lines the collar, while the tongue is adorned with an \'adidas Handball Spezial\' tag. A gum rubber sole unit completes the look.'),('IF9735','adidas Gazelle Indoor Bad Bunny','Adidas','Off White/Black/Gum',9,'U101','https://images.stockx.com/images/adidas-Gazelle-Indoor-Bad-Bunny-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-09-21','The Bad Bunny x adidas Gazelle Indoor \'Core White\' sports an off-white leather upper with matching hairy suede accents on the forefoot, eyestay and heel. Black leather three-stripes meet an \'adidas benito\' signoff right next to them and a size label stitched on the heel. A partially see-through gum rubber outsole completes the look.'),('IG5349','adidas Yeezy Foam RNR Carbon','Adidas','Carbon/Carbon/Carbon',9,'U101','https://images.stockx.com/images/adidas-Yeezy-Foam-RNR-Carbon-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-08-07','The adidas Yeezy Foam Runner \'Carbon\' is an ultramodern slip-on crafted from injected EVA foam, showcased in a dark-grey hue with smooth, flowing lines and a supportive contoured heel. To ensure breathability, the shoe features strategically placed vents on the vamp and side panels. The textured footbed enhances the overall fit, while a robust rubber outsole ensures grippy traction.'),('IG9030','adidas Samba OG Cloud White Core Black (Women\'s)','Adidas','Cloud White/Core Bla',9,'U101','https://images.stockx.com/images/adidas-Samba-OG-Cloud-White-Core-Black-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2023-12-01','The adidas Women’s Samba OG ‘White Clear Granite’ rolls out a white leather upper with grey suede forefoot overlays. Black leather details on the back tab and three-stripes give them their signature contrast. A blue adidas tongue tag gives them a vivid pop of color. The gum rubber cupsole brings smooth traction underfoot.'),('JH6206','adidas Adizero Evo SL White Black','Adidas','Cloud White/Core Bla',9,'U101','https://images.stockx.com/images/adidas-Adizero-Evo-SL-White-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-10-25','Inspired by the Pro Evo 1, the adidas Adizero Evo SL \'White Black\' sports oversized black three-stripes on a white mesh and knit upper, tooled with a molded ergonomic tongue for a comfortable feel. A high-stack foam midsole gets a responsive layer of Lightstrike Pro foam for a soft and resilient feel underfoot. A Continental Rubber outsole provides solid traction with every step.'),('JH7834','adidas BW Army Lux White Gum','Adidas','Footwear White/Footw',9,'U101','https://images.stockx.com/images/adidas-BW-Army-Lux-White-Gum-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1744837943','2025-04-01','No description available'),('JI0280','adidas Samba OG Liberty London Floral Embroidery (','Adidas','Floral Print/Off Whi',9,'U101','https://images.stockx.com/images/adidas-Samba-OG-Liberty-London-Floral-Embroidery-GS-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1742332290','2025-03-17','No description available'),('JI2734','adidas Samba OG Preloved Red Leopard (Women\'s)','Adidas','Core Black/Preloved ',9,'U101','https://images.stockx.com/images/adidas-Samba-OG-Preloved-Red-Leopard-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738344168','2025-01-29','Part of the \'Cheetah Pack,\' the adidas Women\'s Samba OG \'Preloved Red\' is dressed in faux brown pony hair on the upper, decorated with black cheetah spots and contrasting off-white leather touches on the three-stripes and back tab. These shoes sport brick-red laces that match the synthetic leather lining, undergirded by a gum rubber sole unit underfoot.'),('JI2735','adidas Samba OG Black Green Leopard (Women\'s)','Adidas','Core Black/Collegiat',9,'U101','https://images.stockx.com/images/adidas-Samba-OG-Black-Green-Leopard-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738271477','2025-01-29','The adidas Women\'s Samba OG \'Collegiate Green\' comes from the \'Cheetah Pack,\' rocking a brown pony hair upper covered in cheetah spots. Black leather pops land on the eyestay, back tab, three-stripes and T-toe overlay. Green synthetic leather lines the collar, bringing a dash of color. The gum rubber sole nods to the model\'s indoor soccer roots.'),('JN7119','BAPE x adidas Shark Fleece Full Zip Hoodie Black','Adidas','Black',9,'U101','https://images.stockx.com/images/BAPE-x-adidas-Shark-Fleece-Full-Zip-Hoodie-Black.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1743529294','2025-04-05','No description available'),('JP5309','adidas Gazelle Indoor Liberty London Floral Embroi','Adidas','Off-White/Multi',9,'U101','https://images.stockx.com/images/adidas-Gazelle-Indoor-Liberty-London-Floral-Embroidery-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1741384948','2025-01-10','The Liberty London x adidas Women\'s Gazelle Indoor \'Floral Embroidery\' rolls out an embroidered floral print throughout the knit upper. Off-white suede details on the eyestay and serrated three-stripes act as a break from the flashy design. A golden Trefoil logo adorns the tongue and insoles. A partially see-through gum rubber cupsole completes the look.'),('JQ2393','adidas Harden Vol. 8 Miami Nights','Adidas','Pulse Magenta/Core B',9,'U101','https://images.stockx.com/images/adidas-Harden-Vol-8-Miami-Nights-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-11-15','No description available'),('JQ6140','adidas AE 1 Low Best of adi 2.0','Adidas','Footwear White/Core ',9,'U101','https://images.stockx.com/images/adidas-AE-1-Low-Best-of-adi-20-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2025-01-01','The adidas AE 1 Low \'Best of Adi 2.0\' brings a mesh upper with a reflective silver overlay on the toe. Large, white support wings have a honeycomb shape for better airflow. Anthony Edwards\' logo adorns the tongue in red, matching adidas\' three-bar logo on the heel. The caged Lightstrike midsole combines with Light Boost for an extra lightweight feel that returns energy with every step.'),('JQ8739','adidas Climamog Off White','Adidas','Off White/Off White/',9,'U101','https://images.stockx.com/images/adidas-Climamog-Off-White-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2024-10-25','The adidas Climamog \'Off White\' uses a lightweight, lattice foam structure for more flexibility and an airy feel. Molded three-stripes decorate the side for a signature