plier Color/Suppl',9,'U101','https://images.stockx.com/images/adidas-AE-1-Low-3SSB-PE-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1743525357','2025-04-19','The adidas AE 1 Low \'3SSB\' rolls out a mesh upper dyed in a gradient blend of turquoise, green, blue and lavender. Pink, honeycomb-structured support wings provide lateral stability, while a caged Lightstrike midsole pairs with Light Boost units on the forefoot and heel, undergirded by a rubber outsole.'),('JR7030','adidas Taekwondo Mei Ballet White Black (Women\'s)','Adidas','Cloud White/Core Bla',9,'U101','https://images.stockx.com/images/adidas-Taekwondo-Mei-Ballet-White-Black-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1742845233','2025-03-15','No description available'),('JR7031','adidas Taekwondo Mei Ballet Black White (Women\'s)','Adidas','Core Black/Cloud Whi',9,'U101','https://images.stockx.com/images/adidas-Taekwondo-Mei-Ballet-Black-White-Womens-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1742845197','2025-03-15','No description available'),('KI0565','adidas Climacool 25 Kith Off White Light Brown','Adidas','Off White/Off White/',9,'U101','https://images.stockx.com/images/adidas-Climacool-25-Kith-Off-White-Light-Brown.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1746128980','2000-01-01','No description available'),('NHK63-058','Nike Pro THERMA-FIT Hyperwarm Hood Black/White','Nike','Black/White',9,'U101','https://images.stockx.com/images/Nike-Pro-Hyperwarm-Hood-Balaclava-Black-Product.jpg?fit=fill&bg=FFFFFF&w=700&h=500&fm=webp&auto=compress&trim=color&q=90&dpr=2&updated_at=1738193358','2022-12-01','The Nike Pro Hyperwarm Hood Balaclava Black is a warm unisex pull-on hood that lightweight and ideal for cold seasons. <br>​<br>​The Nike Pro Hyperwarm Hood Balaclava Black comes with a solid pattern and comes with several other features. Its insulation capacity help in heat retention. This hood is stretchy and offers cold protection from the head to the neck. The design lets it lie smoothly on the head and form a comfortable cover by itself or under helmets. The material is made from 88% polyester and 12% spandex. <br>​<br>​The Nike Pro Hyperwarm Hood Balaclava Black has been on the market for over a decade since its release in June 2012 at a retail price of $30.');
